import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";

const Module1 = () => {
  const navigate = useNavigate();
  const [pageName, setPageName] = useState("");
  const [pageTitle, setPageTitle] = useState("");
  const [pageDescription, setPageDescription] = useState("");

  useEffect(() => {
    if (!window.sessionStorage.getItem("auth")) navigate("/unauthorized");
    fetch(process.env.REACT_APP_API_URL_BASE + "/pages/page/1")
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
        setPageName(data.page.page_name);
        setPageTitle(data.page.page_title);
        setPageDescription(data.page.page_description);
      })
      .catch((error) => console.error(error));
  }, []);

  return (
    <div>
      <h1>CS415 Private Page - Module 1</h1>
      <p>
        <font color="white">This is only accessible when logged in</font>
      </p>

      <h2>{pageName}</h2>
      <p>
        <b>{pageTitle}</b>
      </p>
      <p>
        <font color="white">{pageDescription}</font>
      </p>
    </div>
  );
};

export default Module1;
